"use strict";

const getStrongest = (arr, k) => {
    arr.sort((a, b) => a - b);
    const m = arr[Math.floor((arr.length - 1) / 2)];
    arr.sort((a, b) => {
        const absDiffA = Math.abs(a - m);
        const absDiffB = Math.abs(b - m);
        if (absDiffA !== absDiffB) {
            return absDiffB - absDiffA;
        }
        return b - a;
    });
    return arr.slice(0, k);
};
